import logo from './logo.svg';
import './App.css';
// the game items
import React, { useState } from "react";
import Lobby from "./components/Lobby";
import GameRoom from "./components/GameRoom";

function App() {
  const [meetingUrl, setMeetingUrl] = useState("");

  const startMeeting = async (name) => {
    try {
      const response = await fetch("http://localhost:5000/create-meeting", {
        method: "POST",
      });
      const data = await response.json();
      if (data.meeting_url) {
        setMeetingUrl(data.meeting_url);
      } else {
        alert("Error starting meeting");
      }
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <div className="App">
      {meetingUrl ? (
        <GameRoom meetingUrl={meetingUrl} />
      ) : (
        <Lobby onJoin={startMeeting} />
      )}
    </div>
  );
}

export default App;
